import { StyleSheet} from 'react-native';

const profilePageStyles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#7B7D7D',
      alignItems: 'center',
      justifyContent: 'center',
    },
    text: {
      fontSize:15,
      marginTop:10,
      marginBottom:10,
    },
  });
export {profilePageStyles};
